// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Round {
    struct TokenPrice {
        address tokenAddress;
        uint256 currentPrice;
    }

    struct Bet {
        address tokenAddress;
        uint256 amount;
        address bettor;
    }

    address public immutable factory;
    string public roundName;
    uint256 public immutable startTime;
    uint256 public immutable duration;
    uint256 public immutable endTime;

    mapping(address => uint256) public initialPrices;
    mapping(address => uint256) public tokenTotalBets;
    mapping(address => mapping(address => uint256)) public userBets;

    address[] public registeredTokens;
    Bet[] public bets;

    bool public isActive;
    bool public isFinalized;
    address public winningToken;
    uint256 public totalPrizePool;
    uint256 public winningPoolAmount;

    event BetPlaced(address indexed bettor, address indexed tokenAddress, uint256 amount);
    event RoundFinalized(address indexed winningToken, uint256 winningPercentage);
    event PrizeDistributed(address indexed winner, uint256 amount);

    modifier onlyFactory() {
        require(msg.sender == factory, "Only factory can call");
        _;
    }

    modifier onlyActive() {
        require(isActive && !isFinalized && block.timestamp <= endTime, "Round not active");
        _;
    }

    modifier onlyFinalized() {
        require(isFinalized, "Round not finalized");
        _;
    }

    constructor(
        string memory _roundName, 
        uint256 _duration,
        address[] memory _tokenAddresses,
        uint256[] memory _initialPrices
    ) {
        require(_tokenAddresses.length == _initialPrices.length, "Arrays length mismatch");
        require(_tokenAddresses.length > 1, "Need at least 2 tokens");
        require(_duration > 0, "Duration must be greater than 0");

        factory = msg.sender;
        roundName = _roundName;
        startTime = block.timestamp;
        duration = _duration;
        endTime = block.timestamp + _duration;
        isActive = true;

        // Register all tokens with their initial prices
        for (uint256 i = 0; i < _tokenAddresses.length; i++) {
            require(_tokenAddresses[i] != address(0), "Invalid token address");
            require(_initialPrices[i] > 0, "Invalid initial price");
            require(initialPrices[_tokenAddresses[i]] == 0, "Duplicate token");

            initialPrices[_tokenAddresses[i]] = _initialPrices[i];
            registeredTokens.push(_tokenAddresses[i]);
        }
    }

    function bet(address tokenAddress) external payable onlyActive {
        require(msg.value > 0, "Bet amount must be greater than 0");
        require(initialPrices[tokenAddress] > 0, "Token not registered");

        userBets[msg.sender][tokenAddress] += msg.value;
        tokenTotalBets[tokenAddress] += msg.value;

        bets.push(Bet({
            tokenAddress: tokenAddress,
            amount: msg.value,
            bettor: msg.sender
        }));

        emit BetPlaced(msg.sender, tokenAddress, msg.value);
    }

    function finalize(TokenPrice[] calldata currentPrices) external onlyFactory {
        require(isActive && !isFinalized, "Round not active or already finalized");
        require(block.timestamp >= endTime, "Round not ended yet");
        require(currentPrices.length == registeredTokens.length, "Invalid price data length");

        uint256 maxPercentageIncrease = 0;
        address bestToken = address(0);

        // Find token with highest percentage increase
        for (uint256 i = 0; i < currentPrices.length; i++) {
            TokenPrice memory priceData = currentPrices[i];
            require(initialPrices[priceData.tokenAddress] > 0, "Token not registered");

            uint256 initialPrice = initialPrices[priceData.tokenAddress];
            if (priceData.currentPrice > initialPrice) {
                // Calculate percentage increase in basis points (10000 = 100%)
                uint256 percentageIncrease = ((priceData.currentPrice - initialPrice) * 10000) / initialPrice;
                if (percentageIncrease > maxPercentageIncrease) {
                    maxPercentageIncrease = percentageIncrease;
                    bestToken = priceData.tokenAddress;
                }
            }
        }

        require(bestToken != address(0), "No token had positive performance");

        winningToken = bestToken;
        isFinalized = true;
        totalPrizePool = address(this).balance;
        winningPoolAmount = tokenTotalBets[winningToken];

        // Immediately distribute prizes to winners
        _distributePrizes();

        emit RoundFinalized(winningToken, maxPercentageIncrease);
    }

    function _distributePrizes() internal {
        if (winningPoolAmount == 0) return;

        // Create a dynamic array to track processed users
        address[] memory processedUsers = new address[](bets.length);
        uint256 processedCount = 0;

        for (uint256 i = 0; i < bets.length; i++) {
            Bet memory currentBet = bets[i];

            // Only process winning bets
            if (currentBet.tokenAddress == winningToken) {
                // Check if user already processed
                bool alreadyProcessed = false;
                for (uint256 j = 0; j < processedCount; j++) {
                    if (processedUsers[j] == currentBet.bettor) {
                        alreadyProcessed = true;
                        break;
                    }
                }

                if (!alreadyProcessed) {
                    uint256 userWinningBet = userBets[currentBet.bettor][winningToken];

                    if (userWinningBet > 0) {
                        uint256 prizeAmount = (userWinningBet * totalPrizePool) / winningPoolAmount;

                        // Mark user as processed
                        processedUsers[processedCount] = currentBet.bettor;
                        processedCount++;

                        // Clear user's winning bet to prevent re-processing
                        userBets[currentBet.bettor][winningToken] = 0;

                        (bool success, ) = payable(currentBet.bettor).call{value: prizeAmount}("");
                        if (success) {
                            emit PrizeDistributed(currentBet.bettor, prizeAmount);
                        }
                    }
                }
            }
        }
    }

    function getRegisteredTokens() external view returns (address[] memory) {
        return registeredTokens;
    }

    function getTokenInfo(address tokenAddress) external view returns (
        uint256 initialPrice,
        uint256 totalBets,
        bool isRegistered
    ) {
        initialPrice = initialPrices[tokenAddress];
        totalBets = tokenTotalBets[tokenAddress];
        isRegistered = initialPrice > 0;
    }

    function getUserBetForToken(address user, address tokenAddress) external view returns (uint256) {
        return userBets[user][tokenAddress];
    }

    function getAllTokenTotalBets() external view returns (address[] memory tokens, uint256[] memory amounts) {
        tokens = new address[](registeredTokens.length);
        amounts = new uint256[](registeredTokens.length);

        for (uint256 i = 0; i < registeredTokens.length; i++) {
            tokens[i] = registeredTokens[i];
            amounts[i] = tokenTotalBets[registeredTokens[i]];
        }
    }

    function getUserTotalBets(address user) external view returns (address[] memory tokens, uint256[] memory amounts) {
        tokens = new address[](registeredTokens.length);
        amounts = new uint256[](registeredTokens.length);

        for (uint256 i = 0; i < registeredTokens.length; i++) {
            tokens[i] = registeredTokens[i];
            amounts[i] = userBets[user][registeredTokens[i]];
        }
    }

    function getRoundStats() external view returns (
        string memory name,
        bool active,
        bool finalized,
        uint256 totalTokens,
        uint256 totalPool,
        address winner
    ) {
        name = roundName;
        active = isActive && block.timestamp <= endTime;
        finalized = isFinalized;
        totalTokens = registeredTokens.length;
        totalPool = address(this).balance;
        winner = winningToken;
    }

    function getTimeInfo() external view returns (
        uint256 _startTime,
        uint256 _endTime,
        uint256 _duration,
        uint256 _timeLeft,
        bool _hasEnded
    ) {
        _startTime = startTime;
        _endTime = endTime;
        _duration = duration;
        _timeLeft = block.timestamp >= endTime ? 0 : endTime - block.timestamp;
        _hasEnded = block.timestamp >= endTime;
    }

    function getTokenPriceData() external view returns (
        address[] memory tokenAddresses,
        uint256[] memory prices,
        uint256[] memory betAmounts
    ) {
        tokenAddresses = new address[](registeredTokens.length);
        prices = new uint256[](registeredTokens.length);
        betAmounts = new uint256[](registeredTokens.length);

        for (uint256 i = 0; i < registeredTokens.length; i++) {
            tokenAddresses[i] = registeredTokens[i];
            prices[i] = initialPrices[registeredTokens[i]];
            betAmounts[i] = tokenTotalBets[registeredTokens[i]];
        }
    }
}

contracts/RoundFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Round.sol";

contract RoundFactory {
    struct TokenInfo {
        address tokenAddress;
        string symbol;
        string name;
        uint256 currentPrice;
        bool isActive;
    }

    address public owner;
    uint256 public currentRoundIndex;

    mapping(uint256 => address) public rounds;
    mapping(address => bool) public isValidRound;
    mapping(address => TokenInfo) public supportedTokens;
    address[] public tokenList;

    address public currentActiveRound;

    event RoundCreated(uint256 indexed roundIndex, address indexed roundAddress, string roundName, uint256 tokenCount);
    event TokenAdded(address indexed tokenAddress, string symbol, string name, uint256 initialPrice);
    event TokenRemoved(address indexed tokenAddress);
    event TokenPriceUpdated(address indexed tokenAddress, uint256 oldPrice, uint256 newPrice);
    event RoundFinalized(address indexed roundAddress, address indexed winningToken);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call");
        _;
    }

    constructor(address _owner) {
        owner = _owner;
    }

    function addSupportedToken(
        address tokenAddress, 
        string memory symbol, 
        string memory name,
        uint256 initialPrice
    ) external onlyOwner {
        require(tokenAddress != address(0), "Invalid token address");
        require(initialPrice > 0, "Invalid initial price");
        require(!supportedTokens[tokenAddress].isActive, "Token already supported");

        supportedTokens[tokenAddress] = TokenInfo({
            tokenAddress: tokenAddress,
            symbol: symbol,
            name: name,
            currentPrice: initialPrice,
            isActive: true
        });

        tokenList.push(tokenAddress);

        emit TokenAdded(tokenAddress, symbol, name, initialPrice);
    }

    function updateTokenPrice(address tokenAddress, uint256 newPrice) external onlyOwner {
        require(supportedTokens[tokenAddress].isActive, "Token not supported");
        require(newPrice > 0, "Invalid price");

        uint256 oldPrice = supportedTokens[tokenAddress].currentPrice;
        supportedTokens[tokenAddress].currentPrice = newPrice;

        emit TokenPriceUpdated(tokenAddress, oldPrice, newPrice);
    }

    function updateTokenPrices(address[] calldata tokenAddresses, uint256[] calldata newPrices) external onlyOwner {
        require(tokenAddresses.length == newPrices.length, "Arrays length mismatch");

        for (uint256 i = 0; i < tokenAddresses.length; i++) {
            require(supportedTokens[tokenAddresses[i]].isActive, "Token not supported");
            require(newPrices[i] > 0, "Invalid price");

            uint256 oldPrice = supportedTokens[tokenAddresses[i]].currentPrice;
            supportedTokens[tokenAddresses[i]].currentPrice = newPrices[i];

            emit TokenPriceUpdated(tokenAddresses[i], oldPrice, newPrices[i]);
        }
    }

    function removeSupportedToken(address tokenAddress) external onlyOwner {
        require(supportedTokens[tokenAddress].isActive, "Token not supported");

        supportedTokens[tokenAddress].isActive = false;

        for (uint256 i = 0; i < tokenList.length; i++) {
            if (tokenList[i] == tokenAddress) {
                tokenList[i] = tokenList[tokenList.length - 1];
                tokenList.pop();
                break;
            }
        }

        emit TokenRemoved(tokenAddress);
    }

    function createRound(
        string memory roundName, 
        uint256 duration,
        address[] calldata participatingTokens
    ) external onlyOwner returns (address) {
        require(currentActiveRound == address(0), "Active round exists");
        require(bytes(roundName).length > 0, "Round name required");
        require(duration > 0, "Duration must be greater than 0");
        require(participatingTokens.length > 1, "Need at least 2 tokens");

        // Prepare token data for Round constructor
        address[] memory tokenAddresses = new address[](participatingTokens.length);
        uint256[] memory initialPrices = new uint256[](participatingTokens.length);

        for (uint256 i = 0; i < participatingTokens.length; i++) {
            require(supportedTokens[participatingTokens[i]].isActive, "Token not supported");
            tokenAddresses[i] = participatingTokens[i];
            initialPrices[i] = supportedTokens[participatingTokens[i]].currentPrice;
        }

        bytes32 salt = keccak256(abi.encodePacked(currentRoundIndex, roundName, block.timestamp));

        Round newRound = new Round{salt: salt}(
            roundName, 
            duration, 
            tokenAddresses, 
            initialPrices
        );

        address roundAddress = address(newRound);
        rounds[currentRoundIndex] = roundAddress;
        isValidRound[roundAddress] = true;
        currentActiveRound = roundAddress;

        emit RoundCreated(currentRoundIndex, roundAddress, roundName, participatingTokens.length);

        currentRoundIndex++;
        return roundAddress;
    }

    function finalizeRound(
        address roundAddress,
        Round.TokenPrice[] calldata currentPrices
    ) external onlyOwner {
        require(isValidRound[roundAddress], "Invalid round address");
        require(roundAddress == currentActiveRound, "Not current active round");

        Round round = Round(roundAddress);
        require(round.isActive() && !round.isFinalized(), "Round not active");

        (, , , , bool hasEnded) = round.getTimeInfo();
        require(hasEnded, "Round time not ended yet");

        // Update token prices in factory
        for (uint256 i = 0; i < currentPrices.length; i++) {
            Round.TokenPrice memory priceData = currentPrices[i];
            if (supportedTokens[priceData.tokenAddress].isActive) {
                uint256 oldPrice = supportedTokens[priceData.tokenAddress].currentPrice;
                supportedTokens[priceData.tokenAddress].currentPrice = priceData.currentPrice;
                emit TokenPriceUpdated(priceData.tokenAddress, oldPrice, priceData.currentPrice);
            }
        }

        // Finalize round with new prices
        round.finalize(currentPrices);

        emit RoundFinalized(roundAddress, round.winningToken());

        currentActiveRound = address(0);
    }

    function emergencyFinalizeRound(
        address roundAddress,
        Round.TokenPrice[] calldata currentPrices
    ) external onlyOwner {
        require(isValidRound[roundAddress], "Invalid round address");

        Round round = Round(roundAddress);
        require(round.isActive() && !round.isFinalized(), "Round not active");

        // Update token prices in factory
        for (uint256 i = 0; i < currentPrices.length; i++) {
            Round.TokenPrice memory priceData = currentPrices[i];
            if (supportedTokens[priceData.tokenAddress].isActive) {
                uint256 oldPrice = supportedTokens[priceData.tokenAddress].currentPrice;
                supportedTokens[priceData.tokenAddress].currentPrice = priceData.currentPrice;
                emit TokenPriceUpdated(priceData.tokenAddress, oldPrice, priceData.currentPrice);
            }
        }

        round.finalize(currentPrices);

        emit RoundFinalized(roundAddress, round.winningToken());

        if (currentActiveRound == roundAddress) {
            currentActiveRound = address(0);
        }
    }

    function changeOwner(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "Invalid new owner");
        owner = _newOwner;
    }

    function getSupportedTokens() external view returns (TokenInfo[] memory) {
        TokenInfo[] memory activeTokens = new TokenInfo[](tokenList.length);
        uint256 activeCount = 0;

        for (uint256 i = 0; i < tokenList.length; i++) {
            TokenInfo memory token = supportedTokens[tokenList[i]];
            if (token.isActive) {
                activeTokens[activeCount] = token;
                activeCount++;
            }
        }

        TokenInfo[] memory result = new TokenInfo[](activeCount);
        for (uint256 i = 0; i < activeCount; i++) {
            result[i] = activeTokens[i];
        }

        return result;
    }

    function getTokenPrice(address tokenAddress) external view returns (uint256) {
        require(supportedTokens[tokenAddress].isActive, "Token not supported");
        return supportedTokens[tokenAddress].currentPrice;
    }

    function getTokenPrices(address[] calldata tokenAddresses) external view returns (uint256[] memory) {
        uint256[] memory prices = new uint256[](tokenAddresses.length);

        for (uint256 i = 0; i < tokenAddresses.length; i++) {
            require(supportedTokens[tokenAddresses[i]].isActive, "Token not supported");
            prices[i] = supportedTokens[tokenAddresses[i]].currentPrice;
        }

        return prices;
    }

    function getRoundInfo(uint256 roundIndex) external view returns (
        address roundAddress,
        string memory roundName,
        bool isActive,
        bool isFinalized,
        uint256 totalPrizePool,
        address winningToken
    ) {
        roundAddress = rounds[roundIndex];
        if (roundAddress != address(0)) {
            Round round = Round(roundAddress);
            (roundName, isActive, isFinalized, , totalPrizePool, winningToken) = round.getRoundStats();
        }
    }

    function getCurrentRoundInfo() external view returns (
        address roundAddress,
        string memory roundName,
        bool isActive,
        uint256 tokenCount,
        uint256 totalPrizePool
    ) {
        roundAddress = currentActiveRound;
        if (roundAddress != address(0)) {
            Round round = Round(roundAddress);
            bool isFinalized;
            address winningToken;
            (roundName, isActive, isFinalized, tokenCount, totalPrizePool, winningToken) = round.getRoundStats();
        }
    }

    function canCreateNewRound() external view returns (bool) {
        return currentActiveRound == address(0);
    }
}

